function del_rpt( p, t, s, d, ttle )%DEL_RPT - Produces the final figure and results for the Delay et al. (2004) model %                % Syntax: ths_rpt( p, t, s, d, ttle )%%   p = parameters of the model%   p(1) = a  = 0.183Q/To%   p(2) = t0 = r2S/2.25To%   p(3) = alpha%   p(4) = gamma%   t = measured time%   s = measured drawdown%   d(1) = q = Pumping rate%   d(2) = r = distance from the pumping well %   ttle = Title of the figure %% Description:%   Produces the final figure and results for the Delay et al. (2004)%   model.%% See also: del_dmo, del_dim%clfif(nargin==4) % Default value for d if not given by user  ttle='Interference test';end% Rename the parameters for a more intuitive check of the formulasa=p(1); t0=p(2); alpha=p(3); gamma=p(4);q=d(1); r=d(2);% Compute the transmissivity and storativityT=0.1832339.*q./a;S=2.2458394.*T*t0/r.^2;D=2-2*gamma./(1-alpha+alpha);theta=2.*(gamma-alpha)./(alpha-gamma-1);% Calls an internal script that computes drawdown, derivative, and residualsfunc='del'; rpt_cmp% Defines the text of the left side of the legend lgdl=char('Test data:');lgdl=char(lgdl, sprintf(' Discharge rate: %3.2e m^3/s',q));lgdl=char(lgdl, sprintf(' Radial distance: %0.2g m',r));lgdl=char(lgdl, ' ');lgdl=char(lgdl, 'Hydraulic parameters:');lgdl=char(lgdl, sprintf(' Transmissivity T: %3.1e m^2/s',T));lgdl=char(lgdl, sprintf(' Storativity S: %3.1e',S));lgdl=char(lgdl, sprintf(' Fractal Dimension D: %2.1e',D));lgdl=char(lgdl, sprintf(' Scale exponent theta: %2.1e',theta));% Defines the text of the right side of the legend lgdr=char('Delay et al.(2004) Model ');lgdr=char(lgdr, ' ');lgdr=char(lgdr, 'Fitting parameters:');lgdr=char(lgdr, sprintf(' slope a: %0.2g m',a));lgdr=char(lgdr, sprintf(' intercept t0: %0.2g m',t0));lgdr=char(lgdr, sprintf(' alpha: %0.2g',alpha));lgdr=char(lgdr, sprintf(' gamma: %0.2g',gamma));lgdr=char(lgdr, sprintf(' mean residual: %0.2g m',mr));lgdr=char(lgdr, sprintf(' standard deviation: %0.2g m',sr));% Calls an internal script that place the legendrpt_lgd% Calls an internal script that plot the model and the datarpt_plt